import React, { Component } from 'react';
import { Card, Container, Form, Button, Row, Col, Table } from 'react-bootstrap';
import { withRouter } from "react-router-dom";
import axios from 'axios';

class ListFullfillments extends Component{
    constructor(props){
        super(props);
        this.state = {
        };
    }

    render(){
        return(
            <Container fluid>
                <Card>
                    <Card.Body>
                        <Card.Title>List Fullfillments</Card.Title>
                        <Row>
                            <Table striped hover size="sm">
                                <thead>
                                    <tr>
                                        <th><b>carrierCode</b></th>
                                        <th><b>code</b></th>
                                        <th><b>name</b></th>
                                        <th><b>domestic</b></th>
                                        <th><b>international</b></th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {this.state.ListFullfillments && this.state.ListFullfillments.length > 0 && this.state.ListFullfillments.map((prop) => {
                                        return <tr>
                                            <td>{prop["carrierCode"]}</td>
                                            <td>{prop["code"]}</td>
                                            <td>{prop["name"]}</td>
                                            <td>{prop["domestic"] ? 'Yes' : 'No'}</td>
                                            <td>{prop["international"] ? 'Yes' : 'No'}</td>
                                        </tr>
                                    })}
                                    {
                                        this.state.ListFullfillments && this.state.ListFullfillments.length == 0 &&
                                        <div className='text-center'> No Record found </div>
                                    }
                                </tbody>
                            </Table>      
                        </Row>
                    </Card.Body>
                </Card>
            </Container>
        )
    }
}

export default withRouter(ListFullfillments);
